import React from 'react'

export default function NoticeSection(props) {
        return (
        <> 
        {
            (props.notices).map((value,index)=>{
            return(
                <div>
                {value.title}
                {console.log(value)}
                </div>
            )
            })}
            <div className="accordion" id="accordionExample" style={{width:'90%'}}>
                <div className="accordion-item">
                    <button className="accordion-button" type="button" data-bs-toggle="collapse" data-bs-target="#collapseOne" aria-expanded="true" aria-controls="collapseOne">
                     {props.notices[0].title}
                        <p className='accordian-date'></p>
                    </button>
                    <div id="collapseOne" className="accordion-collapse collapse show" data-bs-parent="#accordionExample">
                    <div className="accordion-body">
                        <strong>This is the first item's accordion body.</strong> overflow.
                    </div>
                    </div>
                </div>
            </div>
        </>
    )
}
